import{_ as e,o as t,c as a,a as i}from"./app.72da6e84.js";var r="/aktivitaeten/BDM-2025-03/00_03-2025.jpg",n="/aktivitaeten/BDM-2025-03/01_03-2025.jpg",s="/aktivitaeten/BDM-2025-03/02_03-2025.jpg",d="/aktivitaeten/BDM-2025-03/03_03-2025.jpg",l="/aktivitaeten/BDM-2025-03/04_03-2025.jpg",m="/aktivitaeten/BDM-2025-03/05_03-2025.jpg",o="/aktivitaeten/BDM-2025-03/06_03-2025.jpg",p="/aktivitaeten/BDM-2025-03/07_03-2025.jpg",c="/aktivitaeten/BDM-2025-03/08_03-2025.jpg",h="/aktivitaeten/BDM-2025-03/09_03-2025.jpg",_="/aktivitaeten/BDM-2025-03/10_03-2025.jpg",g="/aktivitaeten/BDM-2025-03/11_03-2025.jpg",u="/aktivitaeten/BDM-2025-03/12_03-2025.jpg",v="/aktivitaeten/BDM-2025-03/13_03-2025.jpg",B="/aktivitaeten/BDM-2025-03/14_03-2025.jpg",M="/aktivitaeten/BDM-2025-03/15_03-2025.jpg",k="/aktivitaeten/BDM-2025-03/16_03-2025.jpg",D="/aktivitaeten/BDM-2025-03/17_03-2025.jpg",b="/aktivitaeten/BDM-2025-03/18_03-2025.jpg",f="/aktivitaeten/BDM-2025-03/19_03-2025.jpg";const j={},w=i('<h1 id="bilder-des-monats-marz-2025" tabindex="-1"><a class="header-anchor" href="#bilder-des-monats-marz-2025" aria-hidden="true">#</a> Bilder des Monats M\xE4rz 2025</h1><p>Mal wieder meinen Haustrail aktiviert, seit langem mal wieder mit der EFHW (was den Aufbau ziemlich verl\xE4ngert aber Bandwechsel sehr vereinfacht hat). Auf 20m ein gewaltiges Pileup in CW gehabt, man h\xF6rte z.T. nur einen Dauerton. Sp\xE4ter dann noch entspannt SSB und am Ende 41 QSOs in ca. anderthalb Stunden. Bei dem herrlichen Wetter sehr angenehm. DF9HC</p><p><img src="'+r+'" alt="Bilder des Monats"><img src="'+n+'" alt="Bilder des Monats"><img src="'+s+'" alt="Bilder des Monats"></p><p>Die beiden \u201E7px\u201C ops sorgten in DE-0515 auf 15m zwar f\xFCr etwas Verwirrung. Dennoch war f\xFCr DO7PX und DG7PX nach knapp 2h Betrieb nicht nur der Akku leer sondern mit \xFCber 30 OSOs auch der Park satt aktiviert.</p><p><img src="'+d+'" alt="Bilder des Monats"><img src="'+l+'" alt="Bilder des Monats"></p><p>DC1TC war mal wieder bei herrlichem Fr\xFChlingswetter in DE-0806 Elbpark Entenwerder.</p><p><img src="'+m+'" alt="Bilder des Monats"></p><p>Als M/DC1TC habe ich GB-0401 Hyde Park in London aktivieren k\xF6nnen.</p><p><img src="'+o+'" alt="Bilder des Monats"></p><p>Am 16.03. haben Merlin, DO2LUP, und ich (Harm, DK4HAA) das Naturschutzgebiet Hahnheide, POTA-Referenz DE-0957, besucht und Regen Funkbetrieb vom Aussichtsturm in 125 m \xFC. NN. gemacht. Die meisten Verbindungen kamen auf dem 2m-Band zusammen. Bedingungen, die man in Norddeutschland sonst so nicht erlebt. Aber auch auf Kurzwelle sind ein paar Kontakte trotz schwieriger Bedingungen ins Log gekommen. Dabei habe ich die EFHW an einer Angel seitlich vom Aussichtsturm geh\xE4ngt.</p><p>Nach der POTA-Aktivierung haben wir noch testweise eine Funkfuchssuche im Wald veranstaltet.</p><p>Zur St\xE4rkung gab es im Anschluss eine Auswahl s\xFC\xDFer K\xF6stlichkeiten.</p><p><img src="'+p+'" alt="Bilder des Monats"><img src="'+c+'" alt="Bilder des Monats"><img src="'+h+'" alt="Bilder des Monats"><img src="'+_+'" alt="Bilder des Monats"><img src="'+g+'" alt="Bilder des Monats"><img src="'+u+'" alt="Bilder des Monats"><img src="'+v+'" alt="Bilder des Monats"></p><p>Am 01.03. habe ich einen Testlauf f\xFCr die Funkfuchssuche von draussenfuchs.de und ein paar Tage sp\xE4ter bei bestem Sonnenschein noch ein Fotoshooting f\xFCr die Website gemacht. Vielen Dank an alle Drau\xDFenfunker, die mich inspiriert haben und durch fortlaufendes Feedback das Projekt deutlich voran gebracht haben!</p><p>Harm, DK4HAA</p><p><img src="'+B+'" alt="Bilder des Monats"><img src="'+M+'" alt="Bilder des Monats"><img src="'+k+'" alt="Bilder des Monats"></p><p>Da es jetzt etwas l\xE4nger hell ist abends bin ich nach der Arbeit losgeradelt, um mal wieder DE-0794 zu aktivieren. Ich hatte Lust auf QRP und CW und so waren der FT-817 mit der DF Vertical am Start. Im CW Bereich des 20m Bandes hatte ich \xFCberraschend viel QRM aber am Ende gl\xFCckten dann doch 11 CW und 10 SSB Verbindung mit 5 W. 73 DF9HC</p><p><img src="'+D+'" alt="Bilder des Monats"><img src="'+b+'" alt="Bilder des Monats"><img src="'+f+'" alt="Bilder des Monats"></p>',18),A=[w];function z(F,S){return t(),a("div",null,A)}var H=e(j,[["render",z],["__file","2025-03-30-Bilder-Des-Monats-M\xE4rz.html.vue"]]);export{H as default};
